import React from "react";
import { NavLink } from "react-router-dom"
//styles
import '../styles/nav.css';

const Nav = () => {
    return (
        <nav className='nav'>
            <NavLink to="/" exact='true' className='nav-title'>
                Jaime Castaneda
            </NavLink>
            <div className="nav-social">
                <a>
                    linkedin
                </a>
                <a>
                    instagram
                </a>
                <a>
                    twitter
                </a>
            </div>
            <div className="nav-links">
                <NavLink to="/" exact='true' className='nav-link' style={({ isActive, isPending }) => {
                    return {
                        color: isActive ? "Blue" : "#DCDCDC",
                    };
                }}>
                    home
                </NavLink>
                <NavLink to="/about" exact='true' style={({ isActive, isPending }) => {
                    return {
                        color: isActive ? "Blue" : "#DCDCDC",
                    };
                }}>
                    about
                </NavLink>
                <NavLink to="/showcase" exact='true' style={({ isActive, isPending }) => {
                    return {
                        color: isActive ? "Blue" : "#DCDCDC",
                    };
                }}>
                    showcase
                </NavLink>
            </div>
        </nav>
    );
}

export default Nav;
